export const LABEL_LIST = {
    TEST: [
        {
            Header: "S.NO",
            width: 50,
            filterable: false,
            accessor: 'index',
            disableSortBy: true,
            // isCell: true,
            // cellFormat: 'index',

        },
        {
            Header: "ICCID / SN",
            accessor: 'iccid',
            width: 50,
        },
        {
            Header: 'MDN',
            accessor: 'mdnNo',
            disableSortBy: true,
            width: 50,
            // isCell: true,
            // cellFormat: 'subRowCount'
        },
        {
            Header: "FG Code",
            accessor: 'fgCode',
            width: 50,
        },
        {
            Header: 'DO NUMBER',
            accessor: 'doNumber',
            disableSortBy: true,
            // isCell: true,
            // cellFormat: 'status'
        }
    ]
};
